import classes from "./PastEventAndFightItem.module.css";
import Card from "../ui/Card";
import axios from "axios";
import { useState, useEffect } from "react";
import FightForEvent from "./FightForEvent";

function PastEventAndFightItem(props) {
  const [loadedFights, setLoadedFights] = useState([]);
  const [numberOfFights, setNumberOfFights] = useState("");

    useEffect(() => {
      axios({
        method: "get",
        url: "api/fights/event?eventId=" + props.id,
      }).then((response) => {
        let fights = response.data;
        let ret = [];
        console.log("FAJTOVI", fights);
        for (let i in fights) {
          ret.push(fights[i]);
        }
        setNumberOfFights(ret.length);
        // setIsLoading(false);
        setLoadedFights(ret);
      });
    }, []); // eslint-disable-line react-hooks/exhaustive-deps


  const variable = true;

  const ret = <button>Add results</button>;

  return (
    <li className={classes.item}>
      <Card>
        <div className={classes.content}>
          <h3>{props.name}</h3>
          <div className={classes.actions}>
            <button>View fights</button>
            {variable ? ret : <div></div>}
          </div>
          {/* {numberOfFights === 0 ? (
            zeroFights
          ) : (
            <ul className={classes.list}>
              {loadedFights.map((fight) => (
                <FightForEvent
                  key={fight.id}
                  id={fight.id}
                  redCornerFighter={fight.redCornerFighter}
                  blueCornerFighter={fight.blueCornerFighter}
                  redCornerOdds={fight.redCornerOdds}
                />
              ))}
            </ul>
          )} */}
        </div>
      </Card>
    </li>
  );
}

export default PastEventAndFightItem;
